import { Auth0Provider, useAuth0 } from '@auth0/auth0-react';
import React from 'react';
import { Navigate, Route, BrowserRouter as Router, Routes } from 'react-router-dom';
import './App.css';

// Adjust the path if necessary
import About from './components/About';
import Account from './components/Account';
import Contact from './components/Contact';
import Dashboard from './components/Dashboard';
import FarmersDashboard from './components/FarmersDashboard';
import Header from './components/Header';
import Home from './components/Home';
import Land from './components/Land';
import MapComponent from './components/MapComponent';
import Sidebar from './components/Sidebar';
import SideHome from './components/sidebarHome'; // Import the SideHome component
import SowingForm from './components/SowingForm';

function App() {
  const { isAuthenticated, logout } = useAuth0();

  return (
    <div>
      <Router>
        <Header />
        <Routes>
          {/* You can keep Sidebar route if needed, but typically it's shown based on authentication */}
          <Route path="/sidebar" element={<Sidebar />} />

          {/* Home page accessible to everyone */}
          <Route path="/home" element={<Home />} />

          {/* Protected routes */}
          <Route path="/about" element={isAuthenticated ? <About /> : <Navigate to="/home" />} />
          <Route path="/contact" element={isAuthenticated ? <Contact /> : <Navigate to="/home" />} />
          <Route path="/register" element={<Account />} />
          <Route path="/showing" element={isAuthenticated ? <SowingForm /> : <Navigate to="/home" />} />
          <Route path="/farmersdashboard" element={isAuthenticated ? <FarmersDashboard /> : <Navigate to="/home" />} />
          <Route path="/dashboard" element={isAuthenticated ? <Dashboard /> : <Navigate to="/home" />} />
          <Route path="/land" element={isAuthenticated ? <Land /> : <Navigate to="/home" />} />
          <Route path="/map" element={isAuthenticated ? <MapComponent /> : <Navigate to="/home" />} />

          {/* Redirect to sideHome after login */}
          <Route path="/profile" element={isAuthenticated ? <SideHome /> : <Navigate to="/home" />} />
          <Route path="/" element={<Navigate to={isAuthenticated ? "/sidebarhome" : "/home"} />} />
        </Routes>
      </Router>

      {isAuthenticated && (
        <button onClick={() => logout({ returnTo: window.location.origin })}>Logout</button>
      )}
    </div>
  );
}

// Wrap App component with Auth0Provider
const Root = () => (
  <Auth0Provider
    domain="dev-0va1gvwgwfk0n27p.us.auth0.com"
    clientId="G4oOtJbNvzl9dn8c4bSdoa5EdZsxoOIk"
    authorizationParams={{
      redirect_uri: window.location.origin
    }}
  >
    <App />
  </Auth0Provider>
);

export default Root;
